import { Link } from "react-router-dom";
import Logo from "../images/Logo/HeaderLogo.svg";

export default function Footer() {
  return (
    <Link to="/" className="site-title">
      <img src={Logo} className="h-65 w-60" />
    </Link>
  );
}
